import React from "react";

const Videos = () => {
    return ( 
    <section id="videos">
        <iframe width="100%" height="600" src="https://www.youtube.com/embed/QCi80E3KUv8" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>

    </section>
     );

}

export default Videos;
